INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/punchlines-oxmo_puccino-100x100.jpg','« T’as jeté l’une à l’eau et promis la lune à l’autre. »','Oxmo Puccino','L''Arme De Paix','Les Unes Les Autres');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2011/01/passi_punchlines-100x100.jpg','« Tu nous testes, on te tanne, tu contestes, on te canne. »','Passi','Les Tentations','Le Monde Est A Moi (feat. Akhénaton)');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/seth_gueko.jpg','« Toutes les fans se ruent. J’ai grandi avec des p’tits beurs de rue, pas des p’tits beurre de Lu ! »','Seth Gueko','Drive By en Caravane','Gremlins');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/NTM-Punchlines-100x100.jpg','« Mais là je suis sincèrement parti pour laisser passer mon tour. Un stick de plus et mon cerveau fini dans l’arrière-cour. »','NTM','Paris Sous Les Bombes','Pass Pass Le Oinj');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/tsr_crew-punchlines-100x100.jpg','« Jeune du 18 on nous évite pire que des bactéries, c’est une impasse terrible où tout l’monde pense que si t’as l’Bac t’es riche. »','TSR Crew','A quoi ça rime ?','Jeune du 18');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/punchlines-oxmo_puccino-100x100.jpg','« Du pur son de vermine sur la FM, c’est rare. Comme trouver des couilles dans le slip des élus FN. »','Oxmo Puccino','Opéra Puccino','La loi du point final (feat. Lino)');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/hugo-punchlines-100x100.jpg','« Matte les effets que m’font la tize. La maille qu’on gagne, nous on la pisse. »','Hugo TSR','La salle d’attente','L''habitude de la biture');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/punchlines_stromae-100x100.jpg','« Hé fausse caille, faut calmer cet effet Old School. Avoue que c’est faux et faut que t’effaces les fausses couilles. »','Stromae','Faut qu''t''arrêtes le rap feat. J.E.D.I','null');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/booba1.jpg','« Si y’a des biatches partout, c’est que j’suis dans la boîte. Si ça fait mal, que tu cries, que tu jouis, c’est que j’suis dans ta chatte. »','Booba','Lunatic','Jour de paye');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/sexion-d-assaut-100x100.jpg','« Ils s’assoient au dessus des lois normal qu’on trouve qu’elles puent la merde. »','Sexion d''Assaut','Les Chroniques Du 75, En Attendant L''apogée','Plus Qu''un Son');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2012/02/punchlines_fababy-100x100.jpg','« Lâche l’affaire frère, y’a que le banquier qui peut me régler mon compte. »','Fababy','La force du nombre','Envoie Les Billets');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/booba1.jpg','« J’me lave le pénis à l’eau bénite. »','Booba','0.9','Illégal');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2012/02/punchlines_fababy-100x100.jpg','« Moi j’veux faire battre ton coeur, ça fait pas d’bruit les paires de seufs. »','Fababy','La Symphonie Des Chargeurs','Si Tu Veux De Moi');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/scred_connexion-punchlines-100x100.jpg','« Il faut s’armer d’une patience qui anéantit. Le temps apprend qu’le bonheur marche au ralenti. »','Scred Connexion','Double H Dj Crew','Le Bonheur');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/soprano-punchlines-100x100.jpg','« Mon bonheur est un empire dont tu es la reine, où ton sourire a imposé son règne. »','Soprano','Block Life 4','Dernière chance (feat. Léa Castel)');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/fabe-punchlines-100x100.jpg','« L’espoir est loin. En fait si j’écris, c’est pour éviter de descendre dans la rue en poussant des cris. »','Fabe','Détournement de son','Aujourd''hui');
INSERT INTO punchlines VALUES ('http://www.punchline.fr/wp-content/uploads/2010/12/punchlines-mokless-100x100.jpg','« Ils n’ont pas une dent contre moi, mais une mâchoire entière. »','Mokless','Le poids des mots','Besoin');
